package prasad.leetcode.p438;

import org.junit.Assert;
import org.junit.Test;

import java.util.Arrays;
import java.util.Collections;
import java.util.List;

public class FindAllAnagramsInStringTest {

    @Test
    public void test01() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("cbaebabacd", "abc");
        List<Integer> expected = Arrays.asList(0, 6);
        Assert.assertEquals(expected.size(), startIndices.size());
        Assert.assertTrue(expected.containsAll(startIndices));
    }

    @Test
    public void test02() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("abab", "ab");
        List<Integer> expected = Arrays.asList(0, 1, 2);
        Assert.assertEquals(expected.size(), startIndices.size());
        Assert.assertTrue(expected.containsAll(startIndices));
    }

    @Test
    public void test03() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("cbaebabacd", "c");
        List<Integer> expected = Arrays.asList(0, 8);
        Assert.assertEquals(expected.size(), startIndices.size());
        Assert.assertTrue(expected.containsAll(startIndices));
    }

    @Test
    public void test04() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("cbaeb", "bceba");
        List<Integer> expected = Collections.singletonList(0);
        Assert.assertEquals(expected.size(), startIndices.size());
        Assert.assertTrue(expected.containsAll(startIndices));
    }

    @Test
    public void test05() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("cbaeb", "prqtq");
        Assert.assertEquals(0, startIndices.size());
    }

    @Test
    public void test06() {
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("aaaaaaaaaa", "aaaaaaaaaaaaa");
        Assert.assertEquals(0, startIndices.size());
    }

    @Test
    public void testTime() {
        long start = System.currentTimeMillis();
        List<Integer> startIndices = new FindAllAnagramsInString().findAnagrams("",
                "");
        System.out.println("Time = " + (System.currentTimeMillis() - start) + " ms");
        System.out.println(startIndices.size());
    }
}
